                img="100008343750912"  
                img2="1424683623"/> */}

                <TargetDetails 
                thumbnail={Postings[0].thumbnail}
                description={Postings[0].description}
                img={Postings[0].img}  
                img2="1424683623"/>

                </div>
            </div> 

            </div>  
        </div>
    </div>
</div>
